import { react } from "react";
import { Container, Row, Col, Image } from "react-bootstrap";

const Profile = (user) => {
  return (
    <Container>
      <ul>
        {user.map(item => (
          <div>{item.picture}</div>
        ))}
      </ul>
    </Container>
  );
};

export default Profile;
